import React from 'react';
import { View, FlatList, Button } from 'react-native';
import { createStackNavigator } from '@react-navigation/stack/native'; // Change import

const Stack = createStackNavigator(); // Use createStackNavigator from @react-navigation/stack/native

const exercises = [
  { name: 'Duration Exercise', screen: 'DurationExercise' },
  { name: 'Repetition Exercise', screen: 'RepetitionExercise' },
];

export default function Home({ navigation }) {
  return (
    <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
      <FlatList
        data={exercises}
        renderItem={({ item }) => (
          <Button
            title={item.name}
            onPress={() => navigation.navigate(item.screen)}
          />
        )}
        keyExtractor={(item) => item.screen}
      />
    </View>
  );
}
